import React from "react";
import "./Home.css";
import Product from "./Product";

function Home() {
  return (
    <div className="home">
      <div className="home__container">
        <img
          className="home__image"
          src="https://images-eu.ssl-images-amazon.com/images/G/02/digital/video/merch2016/Hero/Covid19/Generic/GWBleedingHero_ENG_COVIDUPDATE__XSite_1500x600_PV_en-GB._CB428684220_.jpg"
        />

        <div className="home__row">
          {/* Product */}
          <Product
            id="12321341"
            title="Kenwood kMic Stand Mixer for Baking, Stylish Kitcher Mixer with K-beater, Dough Hook and Whisk, 5 Litre Glass Bowl"
            price={29.99}
            image="https://progamedev.net/wp-content/uploads/2021/08/The-lean-startup.jpeg"
            rating={4}
          />

          {/* Product */}
          <Product
            id="49538094"
            title="Kenwood kMix Stand Mixer for Baking, Stylish Kitcher Mixer with K-beater, Dough Hook and Whisk, 5 Litre Glass Bowl"
            price={239.9}
            image="https://m.media-amazon.com/images/I/61etD4-IrPL._AC_SL1200_.jpg"
            rating={5}
          />
        </div>

        <div className="home__row">
          {/* Product */}
          <Product
            className="product__tv"
            id="4903850"
            title="Samsung LC49RG90SSUXEN 49' Curved LED Gaming Monitor"
            price={199.99}
            image="https://m.media-amazon.com/images/I/71gbNOxAVoL._AC_SL1500_.jpg"
            rating={3}
          />

          {/* Product */}
          <Product
            id="23445930"
            title="Amazon Echo (3rd generation) | Smart speaker with Alexa, Charcoal Fabric"
            price={98.99}
            image="https://icdn.digitaltrends.com/image/digitaltrends/echo-3rd-gen-768x511.jpg"
            rating={5}
          />

          {/* Product */}
          <Product
            id="3254354345"
            title="New Apple iPad Pro (12.9-inch, Wi-Fi, 128GB) - Silver (4th Generation)"
            price={598.99}
            image="https://store.storeimages.cdn-apple.com/4982/as-images.apple.com/is/ipad-pro-12-select-wifi-silver-202104?wid=470&hei=556&fmt=p-jpg&qlt=95&.v=1617126619000"
            rating={4}
          />
        </div>

        <div className="home__row">
          {/* Product */}
          <Product />
        </div>
      </div>
    </div>
  );
}

export default Home;
